import React from 'react';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';
import DatePicker from "react-datepicker";

export default function FormDialog() {
    const [open, setOpen] = React.useState(false);

    const handleClickOpen = () => {
        setOpen(true);
    };

    const handleClose = () => {
        setOpen(false);
    };

    return (
        <div>
            <Button variant="outlined" color="primary" onClick={handleClickOpen}>
                Open form dialog
            </Button>
            <Dialog open={open} onClose={handleClose} aria-labelledby="form-dialog-title">
                <DialogTitle id="form-dialog-title">Schedule a tour</DialogTitle>
                <DialogContent>
                    <DialogContentText>
                        Is there a particular floor plan you would like to tour?
                    </DialogContentText>
                    <select>
                        {/*<select onChange={this.setFloorPlan}>*/}
                        <option>No, Thank you</option>
                        <option>1x1(1 bed, 1 bath)</option>
                        <option>2x2(2 bed, 2 bath)</option>
                        <option>3x3(3 bed, 3 bath)</option>
                        <option>4x4(4 bed, 4 bath)</option>
                    </select>
                    <DatePicker
                        // selected={this.state.date}
                        selected={new Date()}
                        // onChange={this.handleChange}
                        minDate={new Date((new Date()).valueOf() + 1000*3600*24)}
                    />
                    <br/>
                    <TextField required id="first-name" label="Required" />
                    <TextField
                        autoFocus
                        margin="dense"
                        id="first-name"
                        label="First Name"
                        type="email"
                        fullWidth
                    />
                    <TextField
                        autoFocus
                        margin="dense"
                        id="last-name"
                        label="Last Name"
                        type="email"
                        fullWidth
                    />
                    <TextField
                        autoFocus
                        margin="dense"
                        id="name"
                        label="Email Address"
                        type="email"
                        fullWidth
                    />
                </DialogContent>
                <DialogActions>
                    <Button onClick={handleClose} color="primary">
                        Schedule
                    </Button>
                </DialogActions>
            </Dialog>
        </div>
    );
}
